import React, {useEffect} from 'react';
import './App.scss';
import {Provider} from "react-redux";
import {store} from "./redux/store/store";
import axios from "axios";

const App: React.FC = () => {
    useEffect(()=>{
        axios.get('')
    },[])
    return (
        <Provider store={store}>
            <div className="App">
                <h1>Works</h1>
            </div>
        </Provider>
    );
}

export default App;
